/**
 * @module Components
 */
/**
 * HTML Attributes available to set
 * @category Metadata: Attributes
 * @enum
 */
export const Attribute = {
    VISIBLE: "visible",
    STATE: "state",
};
/**
 * @category Metadata: State
 * @enum
 */
export const State = {
    ENABLED: "enabled",
    DISABLED: "disabled",
};
/**
 * Attribute only visible when set to NO
 * @category Metadata: State
 * @enum
 */
export const Visible = {
    YES: "yes",
    NO: "no",
};
/**
 * @category Metadata: Behavior
 * @enum
 */
export const Event = {
    ONHIDE: "onhide",
    ONSHOW: "onshow",
    ONENABLE: "onenable",
    ONDISABLE: "ondisable",
};
/**
 * @category Metadata: Behavior
 * @enum
 */
export const Gesture = {
    CLICK: "click",
};
